CKEDITOR.plugins.setLang("a11yhelp","es",{title:"Instrucciones de accesibilidad",contents:"Ayuda. Para cerrar presione ESC.",legend:[{name:"General",items:[{name:"Barra de herramientas del editor",legend:'Presiona ${toolbarFocus} para navegar por la barra de herramientas. Para moverse por los distintos grupos de herramientas usa las teclas TAB y MAY-TAB. Para moverse por las distintas herramientas usa FLECHA DERECHA o FECHA IZQUIERDA. Presiona "espacio" o "intro" para activar la herramienta.'},{name:"Editor de di\xe1logo",legend:"Dentro de un cuadro de di\xe1logo, presione la tecla TAB para desplazarse al campo siguiente del cuadro de di\xe1logo, pulse SHIFT + TAB para desplazarse al campo anterior, pulse ENTER para presentar cuadro de di\xe1logo, pulse la tecla ESC para cancelar el di\xe1logo. Para los di\xe1logos que tienen varias p\xe1ginas, presione ALT + F10 para navegar a la pesta\xf1a de la lista. Luego pasar a la siguiente pesta\xf1a con TAB o FLECHA DERECHA. Para ir a la ficha anterior con SHIFT + TAB o FLECHA IZQUIERDA. Presione ESPACIO o ENTRAR para seleccionar la p\xe1gina de ficha."},{name:"Editor del men\xfa contextual",legend:"Presiona ${contextMenu} o TECLA MEN\xda para abrir el men\xfa contextual. Entonces mu\xe9vete a la siguiente opci\xf3n del men\xfa con TAB o FLECHA ABAJO. Mu\xe9vete a la opci\xf3n previa con SHIFT + TAB o FLECHA ARRIBA. Presiona ESPACIO o ENTER para seleccionar la opci\xf3n del men\xfa. Abre el submen\xfa de la opci\xf3n actual con ESPACIO o ENTER o FLECHA DERECHA. Regresa al elemento padre del men\xfa con ESC o FLECHA IZQUIERDA. Cierra el men\xfa contextual con ESC."},{name:"Lista del Editor",legend:"Dentro de una lista, te mueves al siguiente elemento de la lista con TAB o FLECHA ABAJO. Te mueves al elemento previo de la lista con SHIFT + TAB o FLECHA ARRIBA. Presiona ESPACIO o ENTER para elegir la opci\xf3n de la lista. Presiona ESC para cerrar la lista."},{name:"Barra de Ruta del Elemento en el Editor",legend:"Presiona ${elementsPathFocus} para navegar a los elementos de la barra de ruta. Te mueves al siguiente elemento bot\xf3n con TAB o FLECHA DERECHA. Te mueves al bot\xf3n previo con SHIFT + TAB o FLECHA IZQUIERDA. Presiona ESPACIO o ENTER para seleccionar el elemento en el editor."}]},{name:"Comandos",items:[{name:"Comando deshacer",legend:"Presiona ${undo}"},{name:"Comando rehacer",legend:"Presiona ${redo}"},{name:"Comando negrita",legend:"Presiona ${bold}"},{name:"Comando it\xe1lica",legend:"Presiona ${italic}"},{name:"Comando subrayar",legend:"Presiona ${underline}"},{name:"Comando liga",legend:"Presiona ${liga}"},{name:"Comando colapsar barra de herramientas",legend:"Presiona ${toolbarCollapse}"},{name:"Comando accesar el anterior espacio de foco",legend:"Presiona ${accessPreviousSpace} para accesar el espacio de foco no disponible m\xe1s cercano anterior al cursor, por ejemplo: dos elementos HR adyacentes. Repite la combinaci\xf3n de teclas para alcanzar espacios de foco distantes."},{name:"Comando accesar el siguiente spacio de foco",legend:"Presiona ${accessNextSpace} para accesar el espacio de foco no disponible m\xe1s cercano despu\xe9s del cursor, por ejemplo: dos elementos HR adyacentes. Repite la combinaci\xf3n de teclas para alcanzar espacios de foco distantes."},{name:"Ayuda de Accesibilidad",legend:"Presiona ${a11yHelp}"}]}],backspace:"Backspace",tab:"Tab",enter:"Enter",shift:"May\xfas.",ctrl:"Ctrl",alt:"Alt",pause:"Pausa",capslock:"Bloq. May\xfas.",escape:"Escape",pageUp:"Page Up",pageDown:"Page Down",end:"End",home:"Home",leftArrow:"Left Arrow",upArrow:"Up Arrow",rightArrow:"Right Arrow",downArrow:"Down Arrow",insert:"Insert","delete":"Delete",leftWindowKey:"Left Windows key",rightWindowKey:"Right Windows key",selectKey:"Select key",numpad0:"Numpad 0",numpad1:"Numpad 1",numpad2:"Numpad 2",numpad3:"Numpad 3",numpad4:"Numpad 4",numpad5:"Numpad 5",numpad6:"Numpad 6",numpad7:"Numpad 7",numpad8:"Numpad 8",numpad9:"Numpad 9",multiply:"Multiply",add:"Add",subtract:"Subtract",decimalPoint:"Decimal Point",divide:"Divide",f1:"F1",f2:"F2",f3:"F3",f4:"F4",f5:"F5",f6:"F6",f7:"F7",f8:"F8",f9:"F9",f10:"F10",f11:"F11",f12:"F12",numLock:"Num Lock",scrollLock:"Scroll Lock",semiColon:"Semicolon",equalSign:"Equal Sign",comma:"Comma",dash:"Dash",period:"Period",forwardSlash:"Forward Slash",graveAccent:"Grave Accent",openBracket:"Abrir llave",backSlash:"Backslash",closeBracket:"Cerrar llave",singleQuote:"Comillas simples"});